export default {
    header : {
        name : 'Project Information Management',
    },
    navigation : {
        title : 'Project list',
        new : 'New',
        project : 'Project',
        customer : 'Customer',
        supplier : 'Supplier'
    },
    errorScreen : {
        unexpected : 'Unexpected error occurred',
        please : 'Please',
        contact : 'contact your administrator',
        or : 'or',
        back : 'back to search project'
    }
}
